from dbraw import RawMediaRootData, RawMediaDeepDatadef test_mediadata():    mediaTypeName = "Album"    artistID = '12345'    albumID = '56789'    name = "My Album"    pdbid = "-".join([mediaTypeName, f"Art{artistID}", f"Alb{albumID}"])    mediaRootData = RawMediaRootData(pdbid=pdbid, dbid=albumID, name=name)    assert isinstance(mediaRootData.get(), dict), "Could not construct mediaRootData"        artist = "My Artist"    artids = [artistID]    url = "http://www.myurl.com"    year = "1979"    mediaDeepData = RawMediaDeepData(pdbid=pdbid, dbid=albumID, artids=artids,                                     name=name, artist=artist, url=url,                                     group=mediaTypeName, year=year)    assert isinstance(mediaDeepData.get(), dict), "Could not construct RawMediaDeepData"        def test_mediadata_eq():    mediaTypeName = "Album"    artistID = '12345'    albumID = '56789'    name = "My Album"    pdbid = "-".join([mediaTypeName, f"Art{artistID}", f"Alb{albumID}"])        artist = "My Artist"    artids = [artistID]    url = "http://www.myurl.com"    year = "1979"        mediaDeepData1 = RawMediaDeepData(pdbid=pdbid, dbid=albumID, artids=artids,                                      name=name, artist=artist, url=url,                                      group=mediaTypeName, year=year)    artist = "My Artist"    artids = [artistID]    url = "http://www.myurl.com"    year = "1997"    mediaDeepData2 = RawMediaDeepData(pdbid=pdbid, dbid=albumID, artids=artids,                                      name=name, artist=artist, url=url,                                      group=mediaTypeName, year=year)    assert mediaDeepData1 != mediaDeepData2        if __name__ == "__main__":    test_mediadata()    test_mediadata_eq()